import React  from 'react';
import { Link } from 'react-router-dom';
import { useState } from 'react';
import { useContext } from 'react';
import { ApiContext } from '../context/ApiContext'


const Appfooter = () => {
    const { profile} = useContext(
        ApiContext
      );

        return (
            <div className="app-footer border-0 shadow-lg bg-primary-gradiant">
                <Link to="/home" className="nav-content-bttn nav-center"><i className="feather-home"></i></Link>
                <Link to="/recommend" className="nav-content-bttn"><i className="feather-zap"></i></Link>
                <Link to="/recommenduser" className="nav-content-bttn" data-tab="chats"><i className="feather-user"></i></Link>           
                {/* <Link to="/request" className="nav-content-bttn"><i className="feather-bell"></i></Link> */}
                <Link to="/userpage" className="nav-content-bttn"><img src={profile.img} alt="user" className="w40 shadow-xss rounded-circle" /></Link>
            </div>        
        );

}

export default Appfooter;
